""" Test to check that get_session_request returns expected dict."""
error_message = """
Test: {} 
Expected: {}
Actual:   {}
"""
test_params = METRIC_TEST_PARAMS
for test, params in test_params.items():
    request_parameters = {'method': params['method'], 'session_id': params[
        'session_id'], 'metric': params['metric'], 'auth_token': AUTH_TOKEN,
        'params': '', 'data': ''}
    expected = {'method': params['method'], 'url': BASE_URL + VERSION +
        SESSION_SUFFIX + '/' + params['session_id'] + params['metric'],
        'attributes': {'headers': params['headers'], 'params': '', 'data': ''}}
    self.director = RequestDirector(**request_parameters)
    actual = self.director.get_session_request()
    self.assertEqual(expected, actual, error_message.format(test, expected,
        actual))
